import React from "react";

const Sidebar = () => {
  return (
    <div class="bd-sidebar">
      <h3>Navigation Menu</h3>
      <button class="btn btn-primary">Item1</button>
      <button class="btn btn-primary">Item2</button>
      <button class="btn btn-primary">Item3</button>
      <button class="btn btn-primary">Item4</button>
      <button class="btn btn-primary">Item5</button>
    </div>
  );
};

export default Sidebar;
